import './App.css';

function App() {
  return (
    <div className="Parent">
      <nav className="navbar">
        <h1 className="logo">Web Scraper</h1>
        <ul className="nav-links">
          <li className="nav-link Home"><a href="#">Home</a></li>
          <li className="nav-link About">About</li>
        </ul>
      </nav>
      <div className="content">
        <h1 className="title">Web Scraper</h1>
        <input className="url-box" placeholder="Enter URL to Scrape"></input>
      </div>
    </div>
  );
}

export default App;
